    @SneakyThrows
    private static @NotNull List<Integer> findAllSpaces(@NotNull String text){
        List<Integer> indexes = new ArrayList<>();
        int nearestIndex = 0;
        do {
            int index = text.indexOf(' ', nearestIndex + 1);
            if(index == -1){
                break;
            }

            nearestIndex = index;
            indexes.add(index + 1);

        }while (true);

        return indexes;
    }
